/*Table structure for table `model` */

DROP TABLE IF EXISTS `model`;

CREATE TABLE `model` (
  `id` int(32) unsigned NOT NULL auto_increment COMMENT 'id',
  `model` varchar(50) character set utf8 NOT NULL COMMENT '型号',
  `hosturl` varchar(128) character set utf8 default NULL COMMENT '数据服务器url',
  `version` varchar(50) character set utf8 default NULL COMMENT '版本号',
  `havedata` int(11) default '0' COMMENT '是否上传了Data数据，1:有，2:无',
  `isforce` int(1) default '0' COMMENT '是否强制升级',
  PRIMARY KEY  (`id`),
  UNIQUE KEY `id` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=latin1;

